import React, { Component } from 'react';
import Heading from '../shared/heading';
import styled from 'styled-components';
import Gap from '../shared/gap';
import {Row, Hr} from '../shared/grid';



class index extends Component {
    render() {
        return (
            <div>
               
                <Row height="80vh" bg="#18bc9c">
                <Heading title="About us" color="#2c3e50"/>
                <Gap h="100px" />
                    <h2>I am a User Interface Developer working on HTML5 / CSS3 /SASS , BS3 / BS4,jQuery, JavaScript, Basic React, React Native ,Basic VueJs, Responsive Web Design , Photoshop with fast learning skill.</h2>
                </Row>
                
            </div>
        )
    }
}


export default  index
